import React from 'react';
import OutstandingFood from './repcipes/outstanding';
import TopFood from './repcipes/top';
 
function Home (){
    return (
        <div className="Home">
            <>
                <OutstandingFood/>
                <TopFood/>
            </>
        </div>
    );
}
 
export default Home;
